const Card = ({ transaction }) => {
  return (
    <div>
      <div>
        <h2>{transaction.description}</h2>
        <p>{transaction.type}</p>
      </div>
      <div>
        <p>{transaction.value}</p>
        <img></img>
      </div>
    </div>
  );
};
export default Card;
